pragma solidity >=0.6.0 <0.8.0;

import "openzeppelin-solidity/contracts/token/ERC20/IERC20.sol";
import "openzeppelin-solidity/contracts/math/SafeMath.sol";
import "openzeppelin-solidity/contracts/access/Ownable.sol";
import "./AssertionRegistry.sol";
import "./ERC721Registry.sol";

/*

UAI/UALs essentially are:

- DID/DID URLs native to the OriginTrail DKG
- uniquely identify physical or digital assets (DID subjects)
- have one or more "owners" (DID controllers)

The specification for UAI/UALs is currently WIP.

*/

contract UAIRegistry is Ownable {
	using SafeMath for uint256;

	IERC20 ERC20Contract;
	ERC721Registry ERC721RegistryContract;
	AssertionRegistry AssertionRegistryContract;

	address ERC20Address;
	address ERC721Address;
	address AssertionRegistryAddress;

	struct AssetRecord{
		uint256 creationTimestamp;
		address controller;
		bytes32 stateCommitHash;
	}

	mapping(uint256 => AssetRecord) public assetRecords;
	mapping(bytes32 => uint256) public assetStake; 

	// events
	event UAIRegistryInit(address indexed ERC20Address, address indexed ERC721Address, address indexed assertionRegistryAddress);
	event AssetCreated(uint256 indexed UAI, bytes32 indexed stateCommitHash);
	event AssetUpdated(uint256 indexed UAI, bytes32 indexed stateCommitHash );
	event TokensDepositedToAsset(bytes32 indexed UAI, uint256 indexed amount, address indexed depositor);

	constructor(address _ERC20Address, address _ERC721Address, address _AssertionRegistryAddress)  public {
		require(_ERC20Address!=address(0));
		require(_ERC721Address!=address(0));
		require(_AssertionRegistryAddress!=address(0));

		ERC20Address = _ERC20Address;
		ERC721Address = _ERC721Address;
		AssertionRegistryAddress = _AssertionRegistryAddress;

		ERC20Contract = IERC20(ERC20Address);
		ERC721RegistryContract = ERC721Registry(ERC721Address);
		AssertionRegistryContract = AssertionRegistry(AssertionRegistryAddress);

		emit UAIRegistryInit(ERC20Address, ERC721Address, AssertionRegistryAddress);
	}

	function createAsset(uint256 UAI, bytes32 stateCommitHash, uint256 tokenAmount) public returns (uint256) {
	//		if (UAI == 0) {
	//			UAI = uint256(keccak256(abi.encodePacked(block.blockhash, msg.sender)));
	//		}

		require(stateCommitHash != 0, "stateCommitHash cannot be zero");
		require(ERC721RegistryContract.exists(UAI) == false, "ERC721 token already exists!");
		require(AssertionRegistryContract.getAssertionCreationTimestamp(stateCommitHash) == 0, "StateCommitHash already exists!");
		require(assetRecords[UAI].creationTimestamp == 0, "UAI already exists!");

		// depositTokens(tokenAmount, UAI); // todo
		AssertionRegistryContract.createAssertionRecord(stateCommitHash, msg.sender, 1); // todo: update when AssertionRegistry is updated
		ERC721RegistryContract.safeMint(msg.sender, UAI);

		assetRecords[UAI].stateCommitHash = stateCommitHash;
		assetRecords[UAI].creationTimestamp = block.timestamp;

		emit AssetCreated(UAI, stateCommitHash);

		return UAI;
	}


	function updateAsset(uint256 UAI, bytes32 newStateCommitHash) public returns (uint256) {
		require(UAI != 0, "UAI cannot be zero");
		require(newStateCommitHash != 0, "newStateCommitHash cannot be zero");
		require(assetRecords[UAI].creationTimestamp != 0, "UAI must exist!");
		require(ERC721RegistryContract.exists(UAI) == true, "ERC721 token must exist!");
		require(AssertionRegistryContract.getAssertionCreationTimestamp(newStateCommitHash) == 0, "StateCommitHash already exists!");

		require(ERC721RegistryContract.ownerOf(UAI) == msg.sender, "Sender is not owner of the asset");

		AssertionRegistryContract.createAssertionRecord(newStateCommitHash, msg.sender, 1); // todo: update when AssertionRegistry is updated
		assetRecords[UAI].stateCommitHash =  newStateCommitHash;
		// todo: store old commits later

		emit AssetUpdated(UAI, newStateCommitHash);

		return UAI;
	}

	// getters
	function getAssetStateCommitHash(uint256 UAI) public view returns(bytes32 stateCommitHash){
		return assetRecords[UAI].stateCommitHash;
	}

	function getAssetOwner(uint256 UAI) public view returns(address owner){
		return ERC721RegistryContract.ownerOf(UAI);
	}

	function getAssetCreationTimestamp(uint256 UAI) public view returns(uint256 creationTimestamp){
		return assetRecords[UAI].creationTimestamp;
	}

	function getAssertionRegistryAddress() public view returns(address _AssertionRegistryAddress){
		return AssertionRegistryAddress;
	}

	function getERC20Address() public view returns(address _ERC20Address){
		return ERC20Address;
	}

	function getERC721Address() public view returns(address _ERC721Address){
		return ERC721Address;
	}


